    fprintf(csvID,cat('             energy release rate, SI [J/m^2], ',num2str(unitConvFactor[13],'%10.5e'),'\\n'))
    fprintf(csvID,cat('             interface stiffness, SI [N/m^3], ',num2str(unitConvFactor[14],'%10.5e'),'\\n'))
    fclose(csvID)
    return projectName